type Transaction struct{
   ThirdPartyTransID string `json:"thirdpartytransid"`
   TransactionTime int64 `json:"transactiontime"`
   TransactionAmount int `json:"transactionamount"`
   PaymentChannel string `json:"paymentchannel"`
   TenantName string `json:"tenantname"`
   MchID string `json:"mchid"`
   LandlordName string `json:"landlordname"`
   ArrivalDate int64 `json:"arrivaldate"`
   VerifyDate int64 `json:"verifydate"` 
   Desc string `json:"desc"`
}
func TestJson(t *testing.T){
	newStr:=strings.ReplaceAll(jsonStr1,"NumberLong(","")
	newStr1:=strings.ReplaceAll(newStr,")","")
	br:=bufio.NewReader(strings.NewReader(newStr1))
	list:=make([]Transaction,0)
	for {
       l,e:=br.ReadBytes('\n')
	   if e==io.EOF{
		   break
	   }
	   element:=Transaction{}
	   err:=json.Unmarshal(l,&element)
	   if err!=nil{
		   t.Log(err.Error())
	   }
	   list=append(list,element)
	//    os.Stdout.Write(l)
	}
   
   for _,v:=range list{
	  t.Logf("三方ID: %s,房东名称: %s,租客名称: %s,支付渠道: %s,商户号: %s,交易金额: %0.2f,交易时间: %s,到账时间: %s,对账时间: %s,交易描述: %s",
	  v.ThirdPartyTransID,v.LandlordName,v.TenantName,v.PaymentChannel,
	  v.MchID,float64(v.TransactionAmount)/100,time.Unix(v.TransactionTime,0).Local().Format("2006-01-02 15:04:05"),
	  time.Unix(v.ArrivalDate,0).Local().Format("2006-01-02 15:04:05"),
	  time.Unix(v.VerifyDate,0).Local().Format("2006-01-02 15:04:05"),v.Desc)
   }
}